import React from 'react';
import mealsjpeg from "../../assets/image.jpeg";
import modules from "./Header.module.css";

const Header = () => {
  return (
  <React.Fragment className={modules}>
  <header> 
      <h1>React Meals</h1>
      <button type="submit">eat please</button>
  </header>
  <div> 
   <img src={mealsjpeg}/>
  </div>;
  </React.Fragment>
  )};

export default Header;
